import React from 'react';

import styles from '../../css/style05.module.css';

const LoginForm = () => {


  return (
    <div className={styles.loginform}>
      <h3>LOGIN</h3>

        <form>
          <table style={{ border: '1' }}>
              <thead></thead>
              <tbody>
                
              </tbody>
              <tfoot></tfoot>
          </table>
        </form>


    </div>
  );
};

export default LoginForm;
